import React from 'react';
import Toolbar from './Toolbar'
import Log from './Log'
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Toolbar/>
      <Log timeStamp="now" category="log" log="hello world" stackTrace="stack" info="info" />
    </div>
  );
}

export default App;
